/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `getPayroll`(accountingDate varchar(30))
BEGIN	 
DECLARE returnInt INT;
DECLARE firstOfNextMonth DATETIME;
DECLARE firstOfCurrentMonth DATETIME;
DECLARE firstOfPreviousMonth DATETIME;
DECLARE lastOfCurrentMonth DATETIME;

DECLARE employeeID INT;
DECLARE amount BIGINT;
DECLARE status VARCHAR(20);
DECLARE flag INT;
declare errorMessage varchar(300);
DECLARE lastOfpreviousMonth DATETIME;
DECLARE lastPayrollDate DATETIME;
DECLARE lastOfNextMonth DATETIME;
DECLARE noOfEntryInCurrentMonth INT;
 SET @returnInt=0;
	SET @status='fixed';
	select @noOfEntryInCurrentMonth=   count(datepart(month,payrollDate)) from payroll where datepart(month, @accountingDate)=datepart(month,payrollDate) and datepart(year, @accountingDate)=datepart(year,payrollDate)  and status=@status;
	select @amount= transportationCost from settings;	 
	if @amount IS NULL then 
		SET @flag=0;
		SET @errorMessage='The transportation cost is not defined';
	END if ;
	if @amount IS  not NULL then 
		 select @firstOfNextMonth= date_add(DATE_ADD(curdate(),interval 1 month) ,interval -(DAY(DATE_ADD(curdate(),interval 1 month))-1) day );
		select @firstOfCurrentMonth=DATE_ADD(curdate(),interval -(DAY(curdate())-1) day);
		select @firstOfPreviousMonth= date_add(DATE_ADD(curdate(),interval -1 month) ,interval -(DAY(DATE_ADD(curdate(),interval -1 month))-1) day );
/*  */
		select @lastOfCurrentMonth= DATE_ADD(DATE_ADD(curdate(),interval 1 month),interval  -(DAY(DATE_ADD(curdate(),interval 1 month ))) day);
		select @lastOfPreviousMonth=DATE_ADD(curdate(), interval -(DAY(curdate())) day);
	    select @lastPayrollDate=payrollDate from payroll where payrollDate between  @firstOfPreviousMonth and @lastOfPreviousMonth; 
		select @lastOfNextMonth= DATE_ADD(DATE_ADD(curdate(),interval 2 month),interval  -(DAY(DATE_ADD(curdate(),interval 2 month ))) day);
	if @lastPayrollDate IS NULL then
		 set @lastPayrollDate= DATE_ADD(curdate(),interval -1 month);
		end if 	;
		  select e.employeefirstname, e.employeelastname,e.personnelNo, p1.payrolldate, p1.amount from employee e join
		  
		   ( select  u.empid empid,  u.payrolldate, sum(u.amount) as amount from  
		  
		  
		   (  
	 
	  
		
		 
		 select s.empID,s.subscriptionID,  @accountingDate payrollDate, @firstOfCurrentMonth month,@amount amount,@status status  from employee_subscription s left join employee_unsubscription us on s.subscriptionID=us.subscriptionID where  s.fromDate <=  @accountingDate   
			and ( us.fromDate>=@firstOfCurrentMonth or us.fromDate is null)	 
		
		 union
			 

			select empID,subscriptionID,  @accountingDate payrollDate, @firstOfPreviousMonth month,@amount amount,@status status    from employee_subscription where  fromDate >=  @lastPayrollDate and fromDate <= @lastOfPreviousMonth 
	 
			 
		
		 


		   ) as u  group by u.empid, u.payrollDate
		  

	  ) as p1 on e.id=p1.empid ;
	end if;
END */;;
