	if noOfEntryInCurrentMonth is not null and noOfEntryInCurrentMonth>0 then
		set returnInt=-1;

		SET	errorMessage='The payroll entry  was done already ';
	end if;
 
	if noOfEntryInCurrentMonth<=0 then
 		 select date_add(DATE_ADD(accountingDate,interval 1 month) ,interval -(DAY(DATE_ADD(accountingDate,interval 1 month))-1) day ) into firstOfNextMonth;
		select DATE_ADD(accountingDate,interval -(DAY(accountingDate)-1) day) into firstOfCurrentMonth;
		select  date_add(DATE_ADD(accountingDate,interval -1 month) ,interval -(DAY(DATE_ADD(accountingDate,interval -1 month))-1) day ) into firstOfPreviousMonth;
  
