insert into log_tst values (' before lastOfPreviousMonth', now());
		select DATE_ADD(accountingDate, interval -(DAY(accountingDate)) day) kk into lastOfPreviousMonth;
insert into log_tst values (' after lastOfPreviousMonth', now());
 
	    select payrollDate into lastPayrollDate  from payroll where payrollDate between  firstOfPreviousMonth and lastOfPreviousMonth  limit 1; 
insert into log_tst values (' before lastOfNextMonth ', now());
		select DATE_ADD(DATE_ADD(accountingDate ,interval 2 month),interval  -(DAY(DATE_ADD(accountingDate,interval 2 month ))) day) into lastOfNextMonth;

	if lastPayrollDate IS NULL then 
		 set lastPayrollDate= DATE_ADD(accountingDate,interval -1 month);
