	/*1. Payroll current month (Dr)


			 */

    	 
			select s.empID,s.subscriptionID,  accountingDate, firstOfCurrentMonth, 
       pcf.flatRate * (
							(
								datediff(
													date_add(least( ifnull(  date_add(us.fromDate,  interval -1 day) , lastOfCurrentMonth), lastOfCurrentMonth), interval 1 day),
													greatest(s.fromDate,firstOfCurrentMonth)
											)
							) /
							(day(last_day(firstOfCurrentMonth)))

						) amount
				,status , s.site  from (select s.*,e.site from employee_subscription s join employee e on s.empID=e.id  )  s left join employee_unsubscription us on s.subscriptionID=us.subscriptionID 
