													date_add(least( ifnull( date_add(us.fromDate,  interval -1 day), lastOfPreviousMonth), lastOfPreviousMonth), interval 1 day),
													greatest(s.fromDate , date_add(lastPayrollDate, interval 1 day) )

											)
