		where  us.fromDate <= firstOfCurrentMonth and us.unsubscriptionDate > lastPayrollDate
		
		) p, employee e where p.empid=e.id and e.site=site order by empType, e.PersonnelNo;



			 
				  	
		end if;

		  
		SET returnInt=1;
 		  
 

end if;

END */;;
