	select count(month(payrollDate)) into noOfEntryInCurrentMonth from payroll where month(accountingDate)=month(payrollDate) and year(accountingDate)=year(payrollDate)  and status=status;
	select transportationCost into amount from settings;
	
	if noOfEntryInCurrentMonth>0 then
		set returnInt=-1;
		SET	errorMessage='The payroll entry  was done already ';
