	if noOfEntryInCurrentMonth<=0 then
	if amount IS NULL then
		SET flag=0;
		SET errorMessage='The transportation cost is not defined';
	END if;
	if amount IS not NULL then
		 select date_add(DATE_ADD(curdate(),interval 1 month) ,interval -(DAY(DATE_ADD(curdate(),interval 1 month))-1) day ) into firstOfNextMonth;
		select DATE_ADD(curdate(),interval -(DAY(curdate())-1) day) into firstOfCurrentMonth;
		select  date_add(DATE_ADD(curdate(),interval -1 month) ,interval -(DAY(DATE_ADD(curdate(),interval -1 month))-1) day ) into firstOfPreviousMonth;
