		select DATE_ADD(DATE_ADD(curdate(),interval 1 month),interval  -(DAY(DATE_ADD(curdate(),interval 1 month ))) day) into lastOfCurrentMonth;
		select DATE_ADD(curdate(), interval -(DAY(curdate())) day) into lastOfPreviousMonth;
	    select payrollDate from payroll where payrollDate between  firstOfPreviousMonth and lastOfPreviousMonth into lastPayrollDate; 
		select DATE_ADD(DATE_ADD(curdate(),interval 2 month),interval  -(DAY(DATE_ADD(curdate(),interval 2 month ))) day) into lastOfNextMonth;
	if lastPayrollDate IS NULL then 
		 set lastPayrollDate= DATE_ADD(curdate(),interval -1 month);
		end if;
 	if lastPayrollDate IS NOT NULL then

	/*1. Payroll current month


			Employees whose subscription effective date is in current month and subscription request date is either in current month or from last payroll date		*/

    		insert into payroll (empid, subscriptionID, payrollDate, month,amount,status) 
			select s.empID,s.subscriptionID,  accountingDate, firstOfCurrentMonth,amount,status  from employee_subscription s left join employee_unsubscription us on s.subscriptionID=us.subscriptionID where  s.fromDate <=  accountingDate   
			and ( us.fromDate>=firstOfCurrentMonth or us.fromDate is null);
		

