/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `makeProRataPayrollEntry`(accountingDate varchar(30) , site int, 
out returnInt VARCHAR(30) )
BEGIN
DECLARE firstOfNextMonth DATETIME;
DECLARE firstOfCurrentMonth DATETIME;
DECLARE firstOfPreviousMonth DATETIME;
DECLARE lastOfCurrentMonth DATETIME;
DECLARE employeeID INT;
 
DECLARE status VARCHAR(20);
DECLARE flag INT;

declare errorMessage varchar(300);
DECLARE lastOfpreviousMonth DATETIME;
DECLARE lastPayrollDate DATETIME;
DECLARE lastOfNextMonth DATETIME;
DECLARE noOfEntryInCurrentMonth INT;

 SET returnInt=0;
	SET status='fixed';
 
 
	 
	select count(month(payrollDate)) into noOfEntryInCurrentMonth from payroll where month(accountingDate)=month(payrollDate) and year(accountingDate)=year(payrollDate)  and status=status and payroll.site=site;
 

	
	if noOfEntryInCurrentMonth is not null and noOfEntryInCurrentMonth>0 then
		set returnInt=-1;

		SET	errorMessage='The payroll entry  was done already ';
	end if;
 
	if noOfEntryInCurrentMonth<=0 then
 		 select date_add(DATE_ADD(accountingDate,interval 1 month) ,interval -(DAY(DATE_ADD(accountingDate,interval 1 month))-1) day ) into firstOfNextMonth;
		select DATE_ADD(accountingDate,interval -(DAY(accountingDate)-1) day) into firstOfCurrentMonth;
		select  date_add(DATE_ADD(accountingDate,interval -1 month) ,interval -(DAY(DATE_ADD(accountingDate,interval -1 month))-1) day ) into firstOfPreviousMonth;
  
		select DATE_ADD(DATE_ADD(accountingDate,interval 1 month),interval  -(DAY(DATE_ADD(accountingDate,interval 1 month ))) day) into lastOfCurrentMonth;
insert into log_tst values (' before lastOfPreviousMonth', now());
		select DATE_ADD(accountingDate, interval -(DAY(accountingDate)) day) kk into lastOfPreviousMonth;
insert into log_tst values (' after lastOfPreviousMonth', now());
 
	    select payrollDate into lastPayrollDate  from payroll where payrollDate between  firstOfPreviousMonth and lastOfPreviousMonth  limit 1; 
insert into log_tst values (' before lastOfNextMonth ', now());
		select DATE_ADD(DATE_ADD(accountingDate ,interval 2 month),interval  -(DAY(DATE_ADD(accountingDate,interval 2 month ))) day) into lastOfNextMonth;

	if lastPayrollDate IS NULL then 
		 set lastPayrollDate= DATE_ADD(accountingDate,interval -1 month);
		end if;

 	if lastPayrollDate IS NOT NULL then

	/*1. Payroll current month (Dr)


			 */

    		insert into payroll(empid, subscriptionID, payrollDate, month,amount,status, site) 
			select s.empID,s.subscriptionID,  accountingDate, firstOfCurrentMonth, 
       pcf.flatRate * (
							(
								datediff(
													date_add(least( ifnull(  date_add(us.fromDate,  interval -1 day) , lastOfCurrentMonth), lastOfCurrentMonth), interval 1 day),
													greatest(s.fromDate,firstOfCurrentMonth)
											)
							) /
							(day(last_day(firstOfCurrentMonth)))

						) amount
				,status , s.site from (select s.*,e.site from employee_subscription s join employee e on s.empID=e.id  ) s left join employee_unsubscription us on s.subscriptionID=us.subscriptionID 
				join employee e on e.id=s.empid join  payroll_config   pcf
				on pcf.site=e.site and pcf.payrolltype='prorata' and pcf.transporttype=1 and accountingDate between pcf.fromDate and ifnull(pcf.toDate,date_add(curdate(), interval 2 day))
				where 
			s.fromDate <=  lastOfCurrentMonth 
				and ( us.fromDate>=firstOfCurrentMonth or us.fromDate is null)  and s.site=site;
		


		
/*	2. payroll previouse month (Dr)
*/
			 

			insert into payroll(empid, subscriptionID, payrollDate, month,amount,status, site) 

			select s.empID,s.subscriptionID,  accountingDate, firstOfPreviousMonth,
			pcf.flatRate * (
							(
								datediff(
													date_add(least( ifnull( date_add(us.fromDate,  interval -1 day), lastOfPreviousMonth), lastOfPreviousMonth), interval 1 day),
													 s.fromDate 
											)
							) /
							(day(last_day(firstOfPreviousMonth)))

						) amount

			,status, s.site
			from (select s.*,e.site from employee_subscription s join employee e on s.empID=e.id  ) s left join employee_unsubscription us on s.subscriptionID=us.subscriptionID  
 				join employee e on e.id=s.empid join  payroll_config   pcf
				on pcf.site=e.site and pcf.payrolltype='prorata' and pcf.transporttype=1 and accountingDate between pcf.fromDate and ifnull(pcf.toDate,date_add(curdate(), interval 2 day))
 			where  s.subscriptionDate > lastPayrollDate  and s.fromDate<=lastOfPreviousMonth  and s.site=site;
		

/*3. payroll previouse month (Cr)

			 */

			 insert into payroll (empid, subscriptionID, payrollDate, month,amount,status, site) 

			select s.empID,s.subscriptionID,  accountingDate, firstOfPreviousMonth,
					-1 * pcf.flatRate * (
							(
								datediff(
													date_add(least( ifnull( date_add(us.fromDate,  interval -1 day), lastOfPreviousMonth), lastOfPreviousMonth), interval 1 day),
													greatest(s.fromDate , date_add(lastPayrollDate, interval 1 day) )

											)
							) /
							(day(last_day(firstOfPreviousMonth)))

						) amount


		,status, s.site    
		from (select s.*,e.site from employee_subscription s join employee e on s.empID=e.id  )   s join employee_unsubscription us on s.subscriptionID=us.subscriptionID  
		join employee e on e.id=s.empid join  payroll_config   pcf
		on pcf.site=e.site and pcf.payrolltype='prorata' and pcf.transporttype=1 and accountingDate between pcf.fromDate and ifnull(pcf.toDate,date_add(curdate(), interval 2 day))
		where  us.fromDate <= firstOfCurrentMonth and us.unsubscriptionDate > lastPayrollDate and s.site=site;
		



			 
				  	
		end if;

		 update payroll set status='fixed', payrollDate=accountingDate where status='pending' and payroll.site=site;
		SET returnInt=1;
 		  
 


end if;

END */;;
