/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `scheduleinsert`(
subscriptionid bigint,
project varchar(20),
from_date datetime,
to_date datetime,
logintime varchar(15),
logouttime varchar(15),
scheduled_by varchar(20),
log_status varchar(5),
status	varchar(5),
out retVal bigint)
BEGIN
declare employee_id bigint;
declare counted bigint;
declare temp bigint;

	select esub.empID into employee_id from employee_subscription esub where esub.subscriptionID=subscriptionid ;
	select  count(*) into counted
from employee_schedule es where es.status='a' and
  ((from_date between es.from_date and IFNULL(es.cancel_date,es.to_date)) or
  (to_date between es.from_date and IFNULL(es.cancel_date,es.to_date))  or
  (from_date <=es.from_date and to_date>=IFNULL(es.cancel_date,es.to_date)))
  and es.subscription_id=subscriptionid ;
	if counted>0 then
	set retVal=-1;
	end	if;
	if counted<=0 then
		insert into employee_schedule (subscription_id,employee_id,project,from_date,to_date,login_time,logout_time,scheduledBy,log_status,status) values (subscriptionid,employee_id,project,from_date,to_date,logintime,logouttime,scheduled_by,log_status,status);
		select  id into retVal from employee_schedule order by id desc limit 1;		
	end if;
END */;;
